css:
.editor .gutter .line-number.refactor-warning .icon-right {
  visibility: visible;
}
.editor .gutter .line-number.refactor-warning .icon-right:before {
  content: "\f059";
  color: #aa8a69;
}
.editor .gutter .line-number.refactor-error .icon-right {
  visibility: visible;
}
.editor .gutter .line-number.refactor-error .icon-right:before {
  content: "\f02d";
  color: #9b4444;
}
.editor .underlayer .refactor-reference.is-disabled {
  display: none;
}
.editor .underlayer .refactor-reference .marker .region {
  position: absolute;
  border-radius: 2px;
  box-sizing: border-box;
  background-color: rgba(54, 175, 144, 0.2);
  border: 1px solid rgba(54, 175, 144, 0.3);
}
.editor .underlayer .refactor-reference .marker .region.first {
  border-radius: 2px 2px 0 0;
}
.editor .underlayer .refactor-reference .marker .region.middle {
  border-radius: 0;
}
.editor .underlayer .refactor-reference .marker .region.last {
  border-radius: 0 0 2px 2px;
}
.editor .underlayer .refactor-error.is-disabled {
  display: none;
}
.editor .underlayer .refactor-error .marker .region {
  position: absolute;
  box-sizing: border-box;
  border-bottom: 1px dotted #ff0000;
}
.status-bar .refactor-status .icon {
  margin-left: 5px;
}
.status-bar .refactor-status .icon:before {
  width: 12px;
  height: 12px;
  font-size: 12px;
  top: 0;
  margin-right: 2px;
}
.status-bar .refactor-status .lint-clean:before {
  color: #68a281;
}
.status-bar .refactor-status .lint-warning:before {
  color: #aa8a69;
}
.status-bar .refactor-status .lint-error:before {
  color: #9b4444;
}
